    data: |
      SELECT DISTINCT col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NOT ( NOT col0 / 53 / 92 * - 36 + - col2 IS NULL ) );
  - name: tab1

outputs:
